window.bookSummaryJSON = "<p><b>To study magic at the university, Siobhan sacrificed her name.</b></p> <p><b>She sacrificed her body and her past. </b></p> <p>Magically disguised as a boy named Sebastien, she is learning wondrous secrets of the thaumaturgic sciences. As Sebastien, she mingles with the young nobles who will one day rule their country. But danger is closer than ever, and she cannot escape her past.</p> <p>The coppers investigating the theft of Siobhan’s priceless transformation artifact have given her a new name: the Raven Queen. As Siobhan does favors for the gang that loaned her the university tuition, the Raven Queen’s mystique only grows.</p> <p>And keeps growing...snowballing out of control until Siobhan’s other identity takes on a life of its own, a fear-inducing bogeyman well beyond the truth of her real capabilities.</p> <p>With the whole city out to get her and trouble hounding both sides of her double life, how will Siobhan ever survive to become the world’s most powerful sorcerer?</p>"; 
